import mc from "./nav-bar.module.scss";

const NavBar = () => {
  return (
    <div className={mc.container}>
      <div>
        <p>Ton score:</p>
      </div>
      <div>
        <h2>Chi-Fu-Mi</h2>
      </div>
      <div>
        <p>score ordi : </p>
      </div>
    </div>
  );
};

export default NavBar;
